@RRKile1 @reisir Utan at eg har fasiten, så trur eg vi snakkar forskjellig kjærleik: 
På gresk (meiner eg å hugse) har du to ord for kjærleik: agape og eros - nestekjærleik og platonsk/erotisk kjærleik. 

Caritate er nestekjærlighet (jf hjelpeorganisasjonen Caritas) medan amoris er synonymt eros.

